import { SET_CURRENT_USER } from '../Actions/types';

const initialState = {};

export const userOrder = (state = initialState, { type, payload }) => {
  switch (type) {
    case SET_CURRENT_USER:
      return { ...state, ...payload };

    default:
      return state;
  }
};
